import React, {useEffect} from "react";

const Home = () => {

  useEffect(() => {
    const now = new Date();
    console.log(now);
    console.log(now.getTime());
  },[]);

  return (
    <div>
      <h1>OK</h1>
    </div>
  );
};

export default Home;
